import React from 'react';
import Header from "../components/Header";
import {Container} from "react-bootstrap";

const AddCheck = () => {
    return (
        <div>
            <Header/>
            <Container className="mt-4">
                <h1>Добавить проверку</h1>
            </Container>
        </div>
    );
};

export default AddCheck;
